        /// <summary>
        ///     Converts this SectionModulus to another SectionModulus with the unit representation <paramref name="unit" />.
        /// </summary>
        /// <param name="unit">The unit to convert to.</param>
        /// <returns>A SectionModulus with the specified unit.</returns>
