        /// <summary>
        ///     Converts this <see cref="SectionModulus"/> to another <see cref="SectionModulus"/> using the given <paramref name="unitConverter"/> with the unit representation <paramref name="unit" />.
        /// </summary>
        /// <param name="unit">The unit to convert to.</param>
        /// <param name="unitConverter">The <see cref="UnitConverter"/> to use for the conversion.</param>
        /// <returns>A SectionModulus with the specified unit.</returns>
        public SectionModulus ToUnit(SectionModulusUnit unit, UnitConverter unitConverter)
        {
            if (TryToUnit(unit, out var converted))
            {
                // Try to convert using the auto-generated conversion methods.
                return converted!.Value;
            }
            else if (unitConverter.TryGetConversionFunction((typeof(SectionModulus), Unit, typeof(SectionModulus), unit), out var conversionFunction))
            {
                // See if the unit converter has an extensibility conversion registered.
                return (SectionModulus)conversionFunction(this);
            }
            else if (Unit != BaseUnit)
            {
                // Conversion to requested unit NOT found. Try to convert to BaseUnit, and then from BaseUnit to requested unit.
                var inBaseUnits = ToUnit(BaseUnit);
                return inBaseUnits.ToUnit(unit);
            }
            else
            {
                // No possible conversion
                throw new NotImplementedException($"Can not convert {Unit} to {unit}.");
            }
        }

        /// <summary>
        ///     Attempts to convert this <see cref="SectionModulus"/> to another <see cref="SectionModulus"/> with the unit representation <paramref name="unit" />.
        /// </summary>
        /// <param name="unit">The unit to convert to.</param>
        /// <param name="converted">The converted <see cref="SectionModulus"/> in <paramref name="unit"/>, if successful.</param>
        /// <returns>True if successful, otherwise false.</returns>
        private bool TryToUnit(SectionModulusUnit unit, [NotNullWhen(true)] out SectionModulus? converted)
        {
            if (Unit == unit)
            {
                converted = this;
                return true;
            }

            SectionModulus? convertedOrNull = (Unit, unit) switch
            {
                // SectionModulusUnit -> BaseUnit
                (SectionModulusUnit.CubicCentimeter, SectionModulusUnit.CubicMeter) => new SectionModulus(_value/1e6, SectionModulusUnit.CubicMeter),
                (SectionModulusUnit.CubicFoot, SectionModulusUnit.CubicMeter) => new SectionModulus(_value*0.0283168, SectionModulusUnit.CubicMeter),
                (SectionModulusUnit.CubicInch, SectionModulusUnit.CubicMeter) => new SectionModulus(_value*1.6387*1e-5, SectionModulusUnit.CubicMeter),
                (SectionModulusUnit.CubicMillimeter, SectionModulusUnit.CubicMeter) => new SectionModulus(_value/1e9, SectionModulusUnit.CubicMeter),

                // BaseUnit -> SectionModulusUnit
                (SectionModulusUnit.CubicMeter, SectionModulusUnit.CubicCentimeter) => new SectionModulus(_value*1e6, SectionModulusUnit.CubicCentimeter),
                (SectionModulusUnit.CubicMeter, SectionModulusUnit.CubicFoot) => new SectionModulus(_value/0.0283168, SectionModulusUnit.CubicFoot),
                (SectionModulusUnit.CubicMeter, SectionModulusUnit.CubicInch) => new SectionModulus(_value/(1.6387*1e-5), SectionModulusUnit.CubicInch),
                (SectionModulusUnit.CubicMeter, SectionModulusUnit.CubicMillimeter) => new SectionModulus(_value*1e9, SectionModulusUnit.CubicMillimeter),

                _ => null
            };

            if (convertedOrNull is null)
            {
                converted = default;
                return false;
            }

            converted = convertedOrNull.Value;
            return true;
        }

